import styled from 'styled-components'

export const Card = styled.div`
    background: rgba(242, 246, 255, 0.97);
    box-shadow: 0px 15px 30px rgba(0, 0, 0, 0.25);
    border-radius: 36px;
    filter: drop-shadow(0px 15px 30px rgba(0, 0, 0, 0.25));
`
